import React from "react"

function Kontakt(){
    return(
        <div style={{marginTop: "4rem"}}>
            <div className="contact-info">
                <div className="card">
                    <i className="card-icon far fa-envelope"></i>
                </div>
            </div>
        </div>
    )
}

export default Kontakt
